"""
You are given an integer array nums that is sorted in non-decreasing order.

Determine if it is possible to split nums into one or more subsequences such that both of the following conditions are true:

	Each subsequence is a consecutive increasing sequence (i.e. each integer is exactly one more than the previous integer).
	All subsequences have a length of 3 or more.

Return true if you can split nums according to the above conditions, or false otherwise.

A subsequence of an array is a new array that is formed from the original array by deleting some (can be none) of the elements without disturbing the relative positions of the remaining elements. (i.e., [1,3,5] is a subsequence of [1,2,3,4,5] while [1,3,2] is not).

Example 1:

Input: nums = [1,2,3,3,4,5]
Output: true
Explanation: nums can be split into the following subsequences:
[1,2,3,3,4,5] --> 1, 2, 3
[1,2,3,3,4,5] --> 3, 4, 5

Example 2:

Input: nums = [1,2,3,3,4,4,5,5]
Output: true
Explanation: nums can be split into the following subsequences:
[1,2,3,3,4,4,5,5] --> 1, 2, 3, 4, 5
[1,2,3,3,4,4,5,5] --> 3, 4, 5

Example 3:

Input: nums = [1,2,3,4,4,5]
Output: false
Explanation: It is impossible to split nums into consecutive increasing subsequences of length 3 or more.

Constraints:

	1 <= nums.length <= 104
	-1000 <= nums[i] <= 1000
	nums is sorted in non-decreasing order.
"""
import sys
import itertools
from heapq import heappop
from heapq import heappush
from collections import Counter
from collections import defaultdict
from typing import Tuple
from typing import Dict
from typing import List
import pytest


class Solution:
    def isPossible(self, nums: List[int]) -> bool:
        """08/07/2020 01:11"""
        cnt = defaultdict(int)
        for n in nums:
            cnt[n] += 1
        ends = defaultdict(int)
        keys = list(cnt.keys())
        for n in keys:
            if cnt[n] == 0:
                continue
            removes = min(ends[n-1], cnt[n])
            ends[n-1] -= removes
            ends[n] += removes
            cnt[n] -= removes
            if cnt[n+1] >= cnt[n] and cnt[n+2] >= cnt[n]:
                cnt[n+1] -= cnt[n]
                cnt[n+2] -= cnt[n]
                ends[n+2] += cnt[n]
            else:
                return False
        return True

    def isPossible(self, nums: List[int]) -> bool:
        """08/28/2022 14:32
        Time Complexity: O(nlogn)
        Space Complexity: O(n)
        """
        ends_at: Dict[int, List[int]] = defaultdict(list)
        for n in sorted(nums):
            if not ends_at.get(n-1):
                heappush(ends_at[n], 1)
            else:
                heappush(ends_at[n], heappop(ends_at[n-1]) + 1)

        return not any(length < 3 for length in itertools.chain(*list(ends_at.values())))

    def isPossible(self, nums: List[int]) -> bool:
        """08/28/2022 15:14
        Time Complexity: O(n)
        Space Complexity: O(n)
        """
        length_so_far = [0, 0, 0] # [length=1, 2, >=3]
        cnt = Counter(nums)
        keys = list(cnt.keys())
        for i, n in enumerate(keys):
            l1, l2, l3 = length_so_far
            if keys[i-1] == n-1:
                if l1+l2 > cnt[n]:
                    return False
                length_so_far = [
                    max(0, cnt[n] - (l1+l2+l3)),
                    l1,
                    l2 + min(l3, cnt[n]-(l1+l2))
                ]
            else:
                if l1+l2 > 0:
                    return False
                length_so_far = [cnt[n], 0, 0]
        return length_so_far[0] + length_so_far[1] == 0


